import styled from 'styled-components';

export const Container = styled.div`
 position: absolute;
 left: 13px;
 top: 103px;
 width: 45%;
 height: 386px;
 background-color:#f1f1f18a;

 h4{
     position:relative;
     top:100px;
     text-align: center;
     font-size: 20px;
     font-family: 'Hina Mincho';
 }
`;
export const ImgCard = styled.div`
 width:400px;
 img{
     width:100%;
 }
`;
